import { platformBrowser } from '@angular/platform-browser';
import { AppModule } from './app/app-module';

(window as any).MonacoEnvironment = {
  getWorkerUrl: function (_moduleId: any, label: string) {
    const workerPath = 'assets/monaco-editor/min/';
    switch (label) {
      case 'json':
        return `${workerPath}vs/language/json/json.worker.js`;
      case 'css':
        return `${workerPath}vs/language/css/css.worker.js`;
      case 'html':
        return `${workerPath}vs/language/html/html.worker.js`;
      case 'typescript':
      case 'javascript':
        return `${workerPath}vs/language/typescript/ts.worker.js`;
      default:
        return `${workerPath}vs/editor/editor.worker.js`;
    }
  }
};


platformBrowser().bootstrapModule(AppModule, {
  ngZoneEventCoalescing: true,
})
  .catch(err => console.error(err));
